import { useState, useEffect } from 'react'
import MovieCard from './NewMovieCard';

// import movies from '../movies.json'

function NewMovieList() {

    const [movies, setMovies] = useState([])

    useEffect(() => {
        fetch('https://api.themoviedb.org/3/movie/now_playing?api_key=9122d3e99f5cf10f65b111a1dcd51b20&language=ru-RU&page=1')
            .then(res => res.json())
            .then(data => {
                setMovies(data.results)
            })
    })

    return (
        <div className="main">
            <div className="movies">
                <div className="container">
                    <div className="movies-inner">
                        <div className="movies-title title">
                            <h1>New Releases</h1>
                        </div>
                        <svg fill="white" data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1200 120" preserveAspectRatio="none">
